Attachments a binary files like images/videos or anything else stored in the WordPress uploads directory. Such binary data is handled a bit differently than textual - because it cannot be easily embedded into a JSON file. Below is a JSONschema describing the attachment slice file format. Download JSONschema definition for media files : slice-attachment.json { "$schema": "http://json-schema.org/draft-07/schema", "title": "Impex Content Slice", "description": "a Impex slice containing content", "type": "object", "properties": { "$schema": { "type": "string", "description": "The JSON schema for this slice" }, "version": { "title": "Impex Provider content version", "description": "Version will be used by Impex to know what data format to expect", "const": "1.0.0" }, "type": { "title": "Impex slice type", "description": "Value will be used by Impex to know the content type of the slice", "const": "php" }, "tag": { "title": "Impex slice tag", "description": "The Impex slice tag contains information about the responsible Impex provider for this slice", "const": "attachment" }, "meta": { "title": "Metadata for the slice", "description": "Metadata is a JSON object used to store additional information about the slice", "const": { "entity": "attachment" } }, "data": { "format": "uri-template", "type": "string", "title": "Data portion of this Impex slice", "description": "Attachment slice data is expected to be a URI to the attachment file.\nFor media it has to be the URI to the image.\nURI can be absolute or relative.", "examples": [ "./media/image.jpg", "https://www.example.com/attachment.jpg" ] } }, "additionalProperties": false, "required": ["version", "type", "tag", "meta", "data"]
} Let's say you have a reference to an image in your content : <img src="./greysen-johnson-unsplash.jpg" /> So you need to import the image into your WordPress instance. To do so, you need to create a slice-*json file (let's name it slice-0002.json) declaring the attachment : { "version": "1.0.0", "type": "resource", "tag": "attachment", "meta": { "entity": "attachment" }, "data": "./greysen-johnson-unsplash.jpg"
} As you can see, there is actually only the data property referencing the image. Rest of the slice file is just boilerplate code. provide the image in the same chunk directory as it's slice json file and prefixed with the slice json file name (slice-0002.json) : slice-0002-greysen-johnson-unsplash.jpg Thats it ! If you import the slice file using Impex, the image will appear in the WordPress uploads directory and in the WordPress media page. If you referenced the image in your content, it will also appear in your imported pages/posts. Remember: Content slices referencing media files should ALWAYS be imported before the attachment slices. This can be achieved by naming content slicing with a lower number than the media slices or - much simpler - keeping the content slices in a lower numbered chunk-* directory than the attachments. See simple-import example for a full featured generated import at the Impex Github page .

